// Dashboard.js
import React from 'react';

function Dashboard({ user, signOut }) {
  return (
    <div>
      <h2>Welcome, {user.email}</h2>
      <button onClick={signOut}>Sign Out</button>
    </div>
  );
}

export default Dashboard;
